import React, { Component } from "react";
import { Menu, Button, Image, Link } from "semantic-ui-react";
import logo from "./logo.png";

export default class Menubar extends Component {
  render() {
    return (
      <Menu inverted pointing>
        <Menu.Menu position="left">
          <Menu.Item id="logo">
            <Image src={logo} href="/home" />
          </Menu.Item>

          <Menu.Item name="home" href="/home" />

          <Menu.Item name="projects" href="/projects" />

          <Menu.Item name="guides" href="/guide" />

          <Menu.Item name="contact" href="/contact" />
        </Menu.Menu>

        <Menu.Menu position="right">
          <Menu.Item>
            <Button name="login" as={Link} to="/login">
              Login
            </Button>

            <span class="divider"> </span>
            <Button primary name="signup" as={Link} to="/signup">
              Signup
            </Button>
          </Menu.Item>
        </Menu.Menu>
      </Menu>
    );
  }
}
